import { Component } from '@angular/core';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent {
  zones = [
    { name: 'International Zone', img: 'assets/zones/International zone.png' },
    { name: 'Entrepreneur Zone', img: 'assets/zones/Entrepreneur zone.png' },
    { name: 'Placement Zone', img: 'assets/zones/Placement zone.png' }
  ];

  Name: string = 'User'; // Replace with dynamic data if needed

  // Cards for the Learning Zone
  learningZoneCards = [
    { title: 'BRAIN VITA', image: 'assets/images/brain-vita.png' },
    { title: 'ENGLISH VINGLISH', image: 'assets/images/english-vinglish.png' },
    { title: 'SHARP SHOOTER', image: 'assets/images/sharp-shooter.png' },
    { title: 'QUIZ MASTER', image: 'assets/images/quiz-master.png' },
    { title: 'LOGIC PUZZLES', image: 'assets/images/logic-puzzles.png' },
    { title: 'WORD BUILDER', image: 'assets/images/word-builder.png' },
  ];

  // Cards for the Skill Zone
  skillZoneCards = [
    { title: 'INSURANCE', image: 'assets/images/insurance.png' },
    { title: 'BANKING', image: 'assets/images/banking.png' },
    { title: 'HOSPITALITY', image: 'assets/images/hospitality.png' },
    { title: 'RETAIL', image: 'assets/images/retail.png' },
    { title: 'IT SKILLS', image: 'assets/images/it-skills.png' },
    { title: 'COMMUNICATION', image: 'assets/images/communication.png' },
  ];
}
